{{Polcompball|posición_ideológica=Izquierda|image1=Demsoc1.png}}
El Socialismo Democrático, comúnmente abreviado como DemSoc, y que no debe confundirse con Social Democracia, es una ideología de izquierda que habita en el centro superior del cuadrante izquierdo libertario. Es uno de los socialistas más moderados. Los socialistas demócratas quieren crear una sociedad democrática demócrata y socialista socialista, generalmente mediante el uso de Democracia liberal. Por lo general, apoyan los medios reformistas para establecer el socialismo. También aboga por la propiedad pública de las grandes empresas y un mercado limitado compuesto por cooperativas de trabajadores o la planificación descentralizada, o una combinación de ambos.
[[en:Democratic Socialism]] [[pl:Demokratyczny socjalizm]]

{{Polcompball|posición_ideológica=Izquierda|image1=Demsoc1.png}}
El Socialismo Democrático, comúnmente abreviado como DemSoc, y que no debe confundirse con Social Democracia, es una ideología de izquierda que habita en el centro superior del cuadrante izquierdo libertario. Es uno de los socialistas más moderados. Los socialistas demócratas quieren crear una sociedad democrática demócrata y socialista socialista, generalmente mediante el uso de Democracia liberal. Por lo general, apoyan los medios reformistas para establecer el socialismo. También aboga por la propiedad pública de las grandes empresas y un mercado limitado compuesto por cooperativas de trabajadores o la planificación descentralizada, o una combinación de ambos.
[[en:Democratic Socialism]] [[pl:Demokratyczny socjalizm]] [[ru:Демократический социализм]]

{{Polcompball|alias=Ancom|fundación_/_fudador=Pyotr Alexeyevich Kropotkin (1842-1921)
Francia, 1892|posición_ideológica=Progresismo, libertarismo}}

Anarco-Comunismo (AnCom) es una ideología libertaria extrema socialista, y culturalmente progresista, que habita la esquina inferior izquierda de la brújula política. Él cree en la abolición del estado y de todas las estructuras del capital, lo que lleva a una sociedad sin estado, sin clases y post-monetaria de basada en una economía del regalo de y la democracia directa. Algunas formas de Anarco-comunismo están fuertemente influenciadas por el egoísmo y el individualismo radical, creyendo que el Ancom es el mejor sistema social para la realización de la libertad individual (aunque esto es ALTAMENTE discutido dentro de varios grupos anarquistas, especialmente en el debate sobre moralidad, ética, libertades individuales, políticas de identidad, libertad de expresión y organización). Muchos  ven el Anarco-comunismo como una forma de reconciliar la brecha entre el individuo y la sociedad. Aunque incluso esto es muy controvertido.

